import { Injectable } from '@angular/core';
import { BehaviorSubject } from 'rxjs';
import { Etiqueta } from 'src/app/models/oficina';
import * as pdfMake from 'pdfmake/build/pdfmake';
import * as pdfFonts from 'pdfmake/build/vfs_fonts';

(pdfMake as any).vfs = pdfFonts.vfs;

@Injectable({
  providedIn: 'root'
})
export class EtiquetasService {

  private colaEtiquetas = new BehaviorSubject<Etiqueta[]>([]);
  etiquetas$ = this.colaEtiquetas.asObservable();

  constructor() { }

  anadirEtiqueta(etiqueta: Etiqueta) {
    const currentItems = this.colaEtiquetas.value;
    this.colaEtiquetas.next([...currentItems, etiqueta]);
  }

  async imprimirEtiquetas(listaEtiquetas?: Etiqueta[]) {

    if (!listaEtiquetas) listaEtiquetas = this.colaEtiquetas.value;

    const imageBase64 = 'data:image/png;base64,';

    const pageWidth = 842;
    const pageHeight = 595;
    const columnas = 3;
    const filas = 5;
    const margenX = 10;
    const margenY = 10;
    const gapX = 10;
    const gapY = 10;

    const anchoEtiqueta = (pageWidth - 2 * margenX - (columnas - 1) * gapX) / columnas;
    const altoEtiqueta = (pageHeight - 2 * margenY - (filas - 1) * gapY) / filas;

    const contenido: any[] = [];

    const paddingInterno = 0;

    listaEtiquetas.forEach((etiqueta, index) => {
      const fila = Math.floor(index / columnas) % filas;
      const columna = index % columnas;

      const x = margenX + columna * (anchoEtiqueta + gapX);
      const y = margenY + fila * (altoEtiqueta + gapY);

      contenido.push({
        stack: [
          {
            canvas: [
              {
                type: 'rect',
                x: paddingInterno,
                y: paddingInterno,
                w: anchoEtiqueta - 2 * paddingInterno,
                h: altoEtiqueta - 2 * paddingInterno,
                lineWidth: 1,
                dash: { length: 3, space: 3 },
                lineColor: '#b2b2b2'
              }
            ],
            absolutePosition: { x, y }
          },
          {
            table: {
              widths: [anchoEtiqueta],
              body: [
                [{
                  stack: [
                    {
                      text: etiqueta.nombre,
                      style: 'titulo',
                      alignment: 'center',
                      margin: [0, 0, 0, 2]
                    },
                    {
                      canvas: [{ type: 'line', x1: 0, y1: 0, x2: anchoEtiqueta, y2: 0, lineWidth: 1 }],
                      margin: [0, 0, 0, 4]
                    },
                    {
                      columns: [
                        {
                          text: `${etiqueta.precio_final.toFixed(2).replace('.', ',')} €`,
                          style: 'precioConIva',
                          width: anchoEtiqueta * 0.60,
                          margin: [10, 14, 0, 0]
                        },
                        {
                          stack: [
                            { text: `ID: ${etiqueta.id_articulo}`, style: 'id', alignment: 'right' },
                            { text: `${etiqueta.precio_sin_iva.toFixed(2).replace('.', ',')} € + IVA`, style: 'precioSinIva', alignment: 'right', margin: [0, 40, 0, 0] }
                          ],
                          width: anchoEtiqueta * 0.35
                        }
                      ],
                      columnGap: 2,
                      margin: [5, 5, 0, 2]
                    },
                    {
                      image: imageBase64,
                      width: anchoEtiqueta * 0.9,
                      opacity: 0.2,
                      alignment: 'center',
                      margin: [0, -97, 0, 0]
                    }
                  ],
                  layout: {
                    hLineWidth: () => 0,
                    vLineWidth: () => 0,
                    paddingTop: (_i: any, _node: any) => 0,
                    paddingBottom: () => 0
                  }
                }]
              ]
            },
            layout: 'noBorders'
          }
        ],
        absolutePosition: { x, y },
        pageBreak: (index > 0 && index % (columnas * filas) === 0) ? 'before' : undefined
      });
    });

    const documento = {
      pageSize: 'A4',
      pageOrientation: 'landscape',
      pageMargins: [0, 0, 0, 0],
      content: contenido,
      styles: {
        titulo: { fontSize: 12, bold: true },
        precioConIva: { fontSize: 35, bold: true },
        id: { fontSize: 10 },
        precioSinIva: { fontSize: 14 }
      },
      defaultStyle: { font: 'Roboto' }
    };

    const pdf = pdfMake.createPdf(documento as any);

    pdf.getBlob((blob) => {
      const url = URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.href = url;
      a.download = 'etiquetas.pdf';
      a.click();
      URL.revokeObjectURL(url);

      this.colaEtiquetas.next([]);
    });
  }
}